package com.example.yevgen.architectmuseo.LandingPage;

import android.os.Bundle;
import android.support.v7.app.AppCompatActivity;
import android.support.v7.widget.LinearLayoutManager;
import android.support.v7.widget.RecyclerView;
import android.support.v7.widget.Toolbar;
import android.util.Log;

import com.example.yevgen.architectmuseo.R;

import java.util.ArrayList;

public class Activity_MainActivity extends AppCompatActivity {

    private RecyclerView mRecyclerView;
    private RecyclerView.Adapter mAdapter;
    private RecyclerView.LayoutManager mLayoutManager;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.activity_main);
        Toolbar toolbar = (Toolbar) findViewById(R.id.toolbar);
        setSupportActionBar(toolbar);

        ArrayList<Object_RVItem> dataList = getCataData();

        mRecyclerView = (RecyclerView)findViewById(R.id.Landing_RV);
        mRecyclerView.setHasFixedSize(true);

        mLayoutManager = new LinearLayoutManager(this);
        mRecyclerView.setLayoutManager(mLayoutManager);

        mAdapter = new Adapter_RVAdapter(dataList, this);
        Log.e("LandingPage", mAdapter.getItemCount()+"");
        mRecyclerView.setAdapter(mAdapter);

    }

    private ArrayList<Object_RVItem> getCataData() {
        ArrayList<Object_RVItem> result = new ArrayList<>();

        Object_RVItem obj1 = new Object_RVItem("");
        obj1.setCataName("Land Mark");
        result.add(obj1);

        Object_RVItem obj2 = new Object_RVItem("");
        obj2.setCataName("Sauna");
        result.add(obj2);

        Object_RVItem obj3 = new Object_RVItem("");
        obj3.setCataName("Museum");
        result.add(obj3);

        return result;
    }


}

